script: |
  super -f tsv -I q1581.sql | sort > q1581.out

vector: true

inputs:
  - name: q1581.sql
    data: |
      SELECT DISTINCT col1 FROM tab0 WHERE NOT ( NOT col2 + - col0 + 33 * + col1 * col0 + - - col0 / col2 * 22 NOT BETWEEN - 17 / ( + CAST ( - col2 AS INTEGER ) ) + col2 AND col1 );
  - name: tab0

outputs:
  - name: q1581.out
    data: |
      1
      21
      81
